import React, { useState } from 'react';
import axios from 'axios';
import '../css/s_log.css';

function StudentLogin() {
    const [showNotification, setShowNotification] = useState(false);
    const [passwordVisible, setPasswordVisible] = useState(false);
    const [Regno, setRegno] = useState('');
    const [password, setPassword] = useState('');
    const [RegnoError, setRegnoError] = useState('');
    const [passError, setPassError] = useState('');
    const [errorMessage, setErrorMessage] = useState('');

    const togglePassword = () => {
        setPasswordVisible(!passwordVisible);
    };

    const validateStudentForm = async (e) => {
        e.preventDefault();
        setRegnoError('');
        setPassError('');
        setErrorMessage('');

        let isValid = true;
        if (Regno.trim() === '') {
            setRegnoError('Registration Number is required.');
            isValid = false;
        }
        if (password.trim() === '') {
            setPassError('Password is required.');
            isValid = false;
        } else if (password.length < 6) {
            setPassError('Password must be at least 6 characters.');
            isValid = false;
        }

        if (!isValid) return;

        try {
            const response = await axios.post("http://localhost:5000/api/auth/studentLogin", {
                Regno,
                password
            });

            localStorage.setItem("token", response.data.token);

            alert("Login successful!");

            window.location.href = "/student-dashboard";  // Redirect after login
        } catch (error) {
            setErrorMessage(error.response?.data?.message || "Login failed. Please try again.");
            setShowNotification(true);
            setTimeout(() => setShowNotification(false), 3000);
        }
    };

    return (
        <div id="std_log">
            {showNotification && (
                <div className="notification">
                    <i>⚠️</i>
                    <span>{errorMessage}</span>
                    <span className="close-btn" onClick={() => setShowNotification(false)}>✖</span>
                </div>
            )}

            <nav className="navbar navbar-expand-lg navbar-light fixed-top py-3" id="mainNav">
                <div className="container px-4 px-lg-5">
                    <img src="assets/logo.png" alt="logo" width="200px" height="50px" className="logo" />
                    <div className="btn-container">
                        <a className="btn" href="/fac_log">
                            <img src="assets/university (1).png" alt="faculty" width="45px" height="45px" />
                            Faculty Log-in
                        </a>
                    </div>
                </div>
            </nav>

            <div className="c2">
                <div id="heading">
                    <h1>Student</h1>
                </div>
                <div className="get_ip">
                    <h2>Log-in</h2>
                    <div className="form" align="center">
                        <form id="StudentForm" onSubmit={validateStudentForm}>
                            <span className="error">{RegnoError}</span>
                            <input
                                type="text"
                                id="Regno"
                                placeholder="Registration Number"
                                name="Regno"
                                value={Regno}
                                onChange={(e) => setRegno(e.target.value)}
                            /><br />

                            <span className="error">{passError}</span>
                            <div className="password-container">
                                <input
                                    type={passwordVisible ? 'text' : 'password'}
                                    id="pass"
                                    placeholder="Password"
                                    name="pass"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                />
                                <span className="toggle-password" onClick={togglePassword}>
                                    <img
                                        src={passwordVisible ? 'assets/eye2.png' : 'assets/eye1.png'}
                                        alt="Show/Hide Password"
                                        id="eye"
                                    />
                                </span>
                            </div>
                            <a href="/forgot-password" className="nyr">Forgot Password?</a>
                            <br /><br />

                            <input type="submit" value="Submit" />
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default StudentLogin;
